      let last = Date.now();
      const step = () => {
        const offset = Date.now() - last;
        fps += 1;
        if (offset >= 1000) {
          last += offset;
          this.appendFps(fps);
          fps = 0;
        }
        requestAnimationFrame(step);
      };

      this.appendFps = fps => {
        if (this.fpsPanel) {
          this.fpsPanel.innerHTML = 'Current FPS is ' + fps + ' FPS';
        }
      };

      step();
    }

